export function PowerToughness(props) {
    return (
        <Stack direction="row" spacing={2}>
            <Text>Power :</Text>
            <Textbox setValue={(value) => props.setPower(value)} placeholder="Power"/>
            <Text>Toughness :</Text>
            <Textbox setValue={(value) => props.setToughness(value)} placeholder="Toughness"/>
         </Stack>
    );
}
